@Component({
  selector: 'app-success-alert',
  templateUrl: './success-alert.component.html',
  styleUrls: ['./success-alert.component.css']
})
export class SuccessAlertComponent {
Username="";

onCreateUser(event:any){
  this.Username=event.target.value
}
}


